  width: 100%;
  display: flex;
  align-items: center;
  justify-content: space-around;

`;


export const Description = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
    width: 50%;

`;


export const Form = styled.form`
  display: flex;
  align-items: center;
  justify-content: center;

  width: 50%;

  span{
    padding: 0 2rem;
  }

`;


export const Text = styled.h1``;
